import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import AddItem from "./AddItem";
import Card from "./Card";
import CardDetails from "./CardDetails";
import Auth from "./Auth";
import SearchMap from './SearchMap';
import { useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";

import ChatLayout from './ChatLayout';

export default function Home() {
    const history = useNavigate();
    const [isUser, setIsUser] = useState(JSON.parse(localStorage.getItem("profile-LostAndFound")));
    const dispatch = useDispatch();

    const [searchKey, setSearchKey] = useState("");
    const [showNotifications, setShowNotifications] = useState(false);
    const [notifications, setNotifications] = useState([
        { id: 1, message: 'New message 1' },
        { id: 2, message: 'New message 2' },
        { id: 3, message: 'New message 3' },
    ]);

    const toggleNotifications = () => {
        setShowNotifications(!showNotifications);
    };

    const handeSearch = (e) => {
        e.preventDefault();
        setSearchKey(e.target.value.toLowerCase());
    }

    useEffect(() => {
        setIsUser(JSON.parse(localStorage.getItem("profile-LostAndFound")));
    }, [history]);

    const handleLogOut = (e) => {
        e.preventDefault();
        dispatch({ type: "LOGOUT" });
        history("/");
        setIsUser(null);
    }

    return (
        <div className="flex h-screen bg-gray-100">
            {/* Sidebar */}
            <div className="hidden md:flex flex-col w-64 bg-gray-800">
                <div className="flex items-center justify-center h-16 bg-gray-900">
                    <span className="text-white font-bold uppercase">Sidebar</span>
                </div>
                <div className="flex flex-col flex-1 overflow-y-auto">
                    <nav className="flex-1 px-2 py-4 bg-gray-800">
                        <Link to="/" className="flex items-center px-4 py-2 text-gray-100 hover:bg-gray-700">
                            <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 mr-2" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16" />
                            </svg>
                            Dashboard
                        </Link>
                        <Link to="/messages" className="flex items-center px-4 py-2 mt-2 text-gray-100 hover:bg-gray-700">
                            <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 mr-2" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M6 18L18 6M6 6l12 12" />
                            </svg>
                            Messages
                        </Link>
                        <Link to="/settings" className="flex items-center px-4 py-2 mt-2 text-gray-100 hover:bg-gray-700">
                            <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 mr-2" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M13 10V3L4 14h7v7l9-11h-7z" />
                            </svg>
                            Settings
                        </Link>
                    </nav>
                </div>
            </div>

            {/* Main Content */}
            <div className="flex flex-col flex-1 overflow-y-auto">
                <div className="flex items-center justify-between h-16 bg-white border-b border-gray-200">
                    <div className="flex items-center px-4">
                        <button className="text-gray-500 focus:outline-none focus:text-gray-700">
                            <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16" />
                            </svg>
                        </button>
                        <input className="mx-4 w-full border rounded-md px-4 py-2" type="text" onChange={handeSearch} placeholder="Search" />
                    </div>
                    <div className="flex items-center pr-4">
                        <button onClick={toggleNotifications} className="flex items-center text-gray-500 hover:text-gray-700 focus:outline-none focus:text-gray-700">
                            <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 19l-7-7 7-7m5 14l7-7-7-7" />
                            </svg>
                        </button>
                    </div>
                </div>
                <div className="p-4">
                    <h1 className="text-2xl font-bold">Welcome to my dashboard!</h1>
                    <p className="mt-2 text-gray-600">This is an example dashboard using Tailwind CSS.</p>
                </div>
            </div>
        </div>
    )
}
